TEST_F(COverlapIntegralsDriverTest, ComputeSSForLiH)
{
    COverlapIntegralsDriver ovldrv(MPI_COMM_WORLD);

    auto mlih = vlxmol::getTestLiH();

    auto mbas = vlxbas::getTestBasisForLiH();

    CGtoBlock bgtos(mlih, mbas, 0);

    CGtoBlock kgtos(mlih, mbas, 0);

    CDenseMatrix ovlmat(4, 4);

    ovldrv.compute(ovlmat.values(), bgtos, kgtos);

    std::vector<double> intvals{1.000000000000000,
                                0.950707129188576,
                                0.153183585372556,
                                0.323354079718979,
                                0.950707129188576,
                                1.000000000000001,
                                0.229357720620491,
                                0.422732158345182,
                                0.153183585372556,
                                0.229357720620491,
                                1.000000000000000,
                                0.803613898079232,
                                0.323354079718979,
                                0.422732158345182,
                                0.803613898079232,
                                1.000000000000000};

    ASSERT_EQ(ovlmat, CDenseMatrix(intvals, 4, 4));
}

